import React from "react";

function LoginWindow(){

    const googleLogin = () => {
        window.open(process.env.GOOGLE_URL || "http://")
    }

    return(
        <div>
            <h1>This is The Login Window</h1>
            <button onClick={googleLogin}>Google+</button>
        </div>
    )
}

export default LoginWindow;
